import React from 'react';
import { Routes, Route } from "react-router-dom";
// import Slider from "react-slick";
// import $ from "jquery";
import './App.css';

function Main() {
  return (
    <React.Fragment>
      <h1>main</h1>
    </React.Fragment>
  )
}

function Login() {
  return (
    <div className='login_wrap'>
      <div className='login_outContainer'>
        <div className='login_innerContainer'>
          <img className='login_img' src='https://cdn-icons-png.flaticon.com/512/6598/6598519.png'></img>
          <h4 className='login_title'>로그인 해서 편지를 받아보세요</h4>
          <img className='login_kakao' src='http://papaspick.com/web/upload/2019_web/icon/kakao_login.jpg'></img>
          <div className='login_text'>
            <span>이용약관</span><span>│</span><span>개인정보처리방침</span><span>│</span><span>ContactUs</span>
          </div>
          <p>소소한프로젝트</p>
        </div>
      </div>
    </div>
  )
}

function App() {

  return (
    <React.Fragment>
      <Routes>
        <Route path="/" element={<Main />}></Route>
        <Route path="/*" element={<Main />}></Route>
        <Route path="/login" element={<Login />}></Route>
      </Routes>
    </React.Fragment>
  );
}

export default App;
